import React from 'react'
import './App.css';
export function Title() {
    return <h1 className="greeting">Credibly</h1>;
  }
 export function LearnMoreButton() {
    return (
      <button>Learn More</button>
    );
  }
  export function App() {
    return (
        <div className='sample-css'>Our Mission</div>

      );
  }
  export function Mission() {
    return(
        <div className='bodystyle'>We believe there are many people out there who are overlooked due to reasons such as past issues, etc.</div>
    )
  }

  export default class InterchangeableText extends App {
     constructor(greeting) {
        super(greeting);
        this.state = {
           title: this.props.defaultText
        }
        this.changeTitle = this.changeTitle.bind(this);
     }

     changeTitle() {
        this.setState({ 
            title: this.props.changedText
        });
     }

     render() {
         return <div onClick={this.changeTitle}>{this.state.title}</div>;
     }

  }

  InterchangeableText.defaultProps = {
      defaultText: 'defaultText',
      changedText: 'changedText'
  }
